import React from 'react';
import {Typography, Box} from '@mui/material';

function Account() {
  return (
    <div>
      <Box sx={{ padding: 2 }}>
        <Typography variant="h3" gutterBottom component="div">
          Account
        </Typography>
      </Box>
    </div>
  )
}

export default Account;
